import Head from 'next/head';
import Navbar from './Navbar';


const Layout = (props) => (
  <div>
    <Head>
      <title>CodeTunes</title>
    </Head>
    <Navbar/>
    {props.children}
    

    <style jsx>{`
    
      * {
        box-sizing: border-box;
        margin: 0;
        padding: 0;
      }

      



    `}</style>
  </div>
)

export default Layout;
